import React from 'react';
import Navbar from './components/Navbar';
import './App.css';
import Accueil from './components/pages/Accueil';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import PageBoutique from './components/pages/PageBoutique';
import PagePanier from './components/pages/PagePanier';
import PageFicheProduit from './components/pages/PageFicheProduit';

function App() {
  return (
    <Router>
      <Navbar />
      <Switch>
        <Route path='/' exact component={Accueil} />
        <Route path='/services' component={PageBoutique} />
        <Route path='/products' component={PagePanier} />
        <Route path='/marketing' component={PageFicheProduit} />
      </Switch>
    </Router>
  );
}

export default App;
